from itertools import product
import numpy as np


def wartoscowanie_do_mozliwosci(liczba, negacja, mozliwosc):
    kombinacje = product([0, 1], repeat=liczba)
    wyniki = []
    for k in list(kombinacje):
        k = np.array(k)
        if negacja:
            k[0] = not k[0]
        # MASKOWANIE JAKIEŚ
        mozliwosc = np.array(mozliwosc)
        mask = mozliwosc == 0
        k[mask] = 0
        wyniki.append(1) if np.count_nonzero(k) % 2 else wyniki.append(0)
    return wyniki

def limit_zmienionych(mozliwy_szyfr, znieksztalcona, max_zmienionych):
    czy_niezmienione = np.array(mozliwy_szyfr) == np.array(znieksztalcona)
    return np.count_nonzero(czy_niezmienione==0) <= max_zmienionych


def formuly(ile_zmiennych, przyklad, max_zmienionych):
    mozliwosci = product([0, 1], repeat=ile_zmiennych-1)

    for mozliwosc in mozliwosci:
        # Bez negacji
        mozliwy_szyfr = wartoscowanie_do_mozliwosci(ile_zmiennych-1, 0, mozliwosc)
        if limit_zmienionych(mozliwy_szyfr, przyklad, max_zmienionych):
            return f"0{mozliwosc}"
        # Z negacją
        mozliwy_szyfr = wartoscowanie_do_mozliwosci(ile_zmiennych-1, 1, mozliwosc)
        if limit_zmienionych(mozliwy_szyfr, przyklad, max_zmienionych):
            return f"1{mozliwosc}"

def czytaj_z_pliku(sciezka):
    with open(sciezka) as file:
        t = file.read().rstrip().split('\n')

    dlugosc_wiadomosci = int(t[0])
    max_zmienionych_bitow = int(t[2])
    przyklady = t[3:]
    for przyklad in przyklady:
        przyklad = [int(x) for x in przyklad]
        print(formuly(dlugosc_wiadomosci, przyklad, max_zmienionych_bitow))

